        <div className="cartItem">
            <img src={productImage} alt="" />
            <div className="description">
                <p>
                    <b>{productName}</b>
                </p>
                <p>${price}</p>
                <div className="countHandler">
                    <button><Trash size={19} /></button>
                    <button><Plus size={32} /></button>
                </div>
            </div>

        </div>
    )
}
